-- opportunity_data_fy2024_2025.sql
-- Auto-generated Opportunity and OpportunityItem data ensuring >=50 deals per seller per fiscal year.
PRAGMA foreign_keys = ON;

-- Opportunity header table
CREATE TABLE IF NOT EXISTS Opportunity (
  id INTEGER PRIMARY KEY,
  account_id INTEGER NOT NULL REFERENCES Account(id),
  owner_user_id INTEGER NOT NULL REFERENCES User(id),
  type TEXT NOT NULL CHECK (type IN ('New', 'Renewal')),
  stage TEXT NOT NULL,
  amount REAL NOT NULL,
  close_date TEXT NOT NULL,
  created_date TEXT NOT NULL,
  probability INTEGER NOT NULL,
  is_closed INTEGER NOT NULL DEFAULT 0,
  is_won INTEGER NOT NULL DEFAULT 0,
  lost_reasons TEXT
);

CREATE INDEX IF NOT EXISTS idx_opportunity_owner ON Opportunity(owner_user_id);
CREATE INDEX IF NOT EXISTS idx_opportunity_account ON Opportunity(account_id);
CREATE INDEX IF NOT EXISTS idx_opportunity_stage ON Opportunity(stage);

-- Opportunity product line items
CREATE TABLE IF NOT EXISTS OpportunityItem (
  id INTEGER PRIMARY KEY,
  opportunity_id INTEGER NOT NULL REFERENCES Opportunity(id),
  product_id INTEGER NOT NULL REFERENCES Product(id),
  quantity INTEGER NOT NULL,
  unit_price REAL NOT NULL,
  amount REAL NOT NULL
);

CREATE INDEX IF NOT EXISTS idx_opportunity_item_product ON OpportunityItem(product_id);

